import React, { useEffect, useState, useContext, useRef} from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { MenuContext } from './App';

const apiKey = 'AIzaSyAyg7Hqr5wUTTv2uL6PMA3-F7fcHBGzhOw';
const mapApiJs = 'https://maps.googleapis.com/maps/api/js';
const geocodeJson = 'https://maps.googleapis.com/maps/api/geocode/json';
const defaultAddress = function () {
    return <span className='text-danger'>
        <u>Address Required Below!</u>
    </span>
};

export default function RestaurantsList(props) {
    const roundedToFixed = props.roundedToFixed;
    const [restaurant, setRestaurant] = useContext(MenuContext);
    const setRestaurantName = props.setRestaurantName;
    const [restaurants, setRestaurants] = useState([]);
    const [restaurantsCopy, setRestaurantsCopy] = useState([]);
    const searchInput = useRef(null);
    const [address, setAddress] = useState({});
    const [latitude, setLatitude] = useState(-1);
    const [longitude, setLongitude] = useState(-1);
    const [distance, setDistance] = useState();
    const [debug, setDebug] = useState(false);
    const [showGetLocation, setShowGetLocation] = useState(false);
    const [menuItemName, setMenuItemName] = useState("");
    const [itemConfig, setItemConfig] = useState([]);
    const [query, setQuery] = useState("");
    useEffect(() => {
        setTimeout(() => {
            placeholderIndex = placeholderIndex > 3 ? placeholderIndex : placeholderIndex++;
            setPhtext(placeholderText[placeholderIndex]);
        }, 5000)

        const timer = () => {
            setIndex(prevIndex => {
              if(prevIndex === placeholderText.length - 1){
                return 0;
              } 
              return prevIndex + 1;
            })
            setPhtext(placeholderText[placeholderIndex]);
          };
          setInterval(timer, 2000);

        axios.get('http://localhost:3000/api/restaurants')
            .then(res => {
                console.log(res.data);
                const r = res.data.map(r => { return r });
                setRestaurants(r);
                setRestaurantsCopy(r);
            });
        initMapScript().then(() => initAutocomplete())
    }, [setRestaurants]);
    function loadAsyncScript(src) {
        return new Promise(resolve => {
            const script = document.createElement("script");
            Object.assign(script, {
                type: "text/javascript",
                async: true,
                src
            })
            script.addEventListener("load", () => resolve(script));
            document.head.appendChild(script);
        })
    }
    const extractAddress = (place) => {
        const address = {
            streetNumber: "",
            street: "",
            city: "",
            state: "",
            zip: "",
        }
        if (!Array.isArray(place?.address_components)) {
            return address;
        }
        place.address_components.forEach(component => {
            const types = component.types;
            const value = component.short_name;
            console.log(component);
            if (types.includes("street_number")) {
                address.streetNumber = value;
            }
            if (types.includes("route")) {
                address.street = value;
            }
            if (types.includes("locality")) {
                address.city = value;
            }
            if (types.includes("administrative_area_level_1")) {
                address.state = value;
            }
            if (types.includes("postal_code")) {
                address.zip = value;
            }
        });
        return address;
    }
    const initMapScript = () => {
        if (window.google) {
            return Promise.resolve();
        }
        const src = `${mapApiJs}?key=${apiKey}&libraries=places,spherical`;
        return loadAsyncScript(src);
    }
    const onChangeAddress = (autocomplete) => {
        const place = autocomplete.getPlace();
        setAddress(extractAddress(place));
        console.log(place.geometry.location);
        setLatitude(place.geometry.location.lat());
        setLongitude(place.geometry.location.lng());
        setShowGetLocation(false);
    }
    const initAutocomplete = () => {
        if (!searchInput.current) return;
        const autocomplete = new window.google.maps.places.Autocomplete(searchInput.current);
        const southwest = { lat: 33.833322851100824, lng: -117.46334029886367 };
        const northeast = { lat: 34.02489224499665, lng: -117.3135582245764 };
        const newBounds = new window.google.maps.LatLngBounds(southwest, northeast);
        autocomplete.setBounds(newBounds);
        autocomplete.setFields(["address_component", "geometry"]);
        autocomplete.addListener("place_changed", () => onChangeAddress(autocomplete));
    }
    function addressDisplayed() {
        return (
            <div className="address">
                <small>
                    Street: {address.streetNumber} {address.street}
                </small>
                <br />
                <small>City: {address.city}</small>
                <br />
                <small>State: {address.state}</small>
                <br />
                <small>Zip: {address.zip}</small>
            </div>
        );
    }
    function plain() {
        const streetNumber = address.streetNumber + " ";
        const street = address.street ? address.street + ", " : "";
        const city = address.city ? address.city + ", " : "";
        const state = address.state ? address.state + ", " : "";
        const zip = address.zip;
        return streetNumber + street + city + state + zip;
    }
    function haversine_dist(lat, lng) {
        var R = 3958.8;
        var rlat1 = latitude * (Math.PI / 180);
        var rlat2 = lat * (Math.PI / 180);
        var difflat = rlat2 - rlat1;
        var difflon = (lng - longitude) * (Math.PI / 180);
        var d = 2 * R * Math.asin(Math.sqrt(Math.sin(difflat / 2) * Math.sin(difflat / 2) + Math.cos(rlat1) * Math.cos(rlat2) * Math.sin(difflon / 2) * Math.sin(difflon / 2)));
        return d;
    }
    function resetAddressWarning(e) {
        return e.target.value.length == 0 ? setShowGetLocation(true) : "";
    }
    function handleSearch(e) {
        let val = e.target.value;
        setQuery(val);

        if (val.length == 0) {
            val = null;
        }

        axios.get('http://localhost:3000/api/menu/item/search', { params: { menuItemName: val } })
            .then(res => {
                setItemConfig(res.data);
                setRestaurants(res.data.length <= 0 ? restaurantsCopy : restaurants.filter((r) => {
                    return res.data.find(x => x.restaurant === r.id);
                }))
            })
    }
    const placeholderText = ["one", "two", "three"];
    const [phtext, setPhtext] = useState("");
    let placeholderIndex = 0;

    return (
        <div>
            <div className="row search">
                {showGetLocation ? <h1>Welcome to Riverside County Delivery!</h1> : ""}
                {showGetLocation ? <h2>We'll deliver fast food, groceries, alcohol, and more...</h2> : ""}
                <div className="col-sm-12">
                    <h6 className="m-1">
                        Deliver to: {showGetLocation ? defaultAddress() : <span>{plain()} <a href="javascript:void(0)" onClick={(e) => setShowGetLocation(true)}>Change</a></span>}
                    </h6>
                    {showGetLocation ?
                        <input
                            style={{ width: "98%" }}
                            className="m-1 mt-0 text-bg-dark text-info"
                            ref={searchInput}
                            type="text"
                            placeholder="Click here to search for delivery address...."
                            onChange={(e) => resetAddressWarning(e)}
                        /> : ""}
                    {debug ? addressDisplayed : ""}
                </div>
            </div>
            <div className="row">
                <div className="col-sm-4">
                    <input placeholder={phtext} className="form-control m-1" value={query} onChange={(e) => handleSearch(e)} type="text" />
                </div>
            </div>
            {!showGetLocation ? restaurants.map((data) => {
                const h = haversine_dist(data.lat, data.lng);
                const fee = h * 1.7;
                const maxFee = 100;
                function selectRestaurant(data) {
                    setRestaurantName(data.name)
                    setRestaurant(data.id)
                }
                return (
                    <Link to={"/showMenu"}>
                        <button
                            className="btn btn-primary m-1"
                            onClick={(e) => selectRestaurant(data)}>
                            <b>{data.name}</b>
                            <br />
                            <small>
                                {data.address}
                                <br />
                                $<span className="">
                                    {fee > maxFee ? "--" : roundedToFixed(fee, 2)}
                                </span> Delivery Fee
                            </small>
                            <br />
                            <small><span className="">
                                {roundedToFixed(h, 1)}</span> Miles
                            </small>
                        </button>
                    </Link>
                );
            }) : ""}
        </div>
    );
}
